import React, { useState, useEffect } from 'react';
import api from '../services/api';

const Results = () => {
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(true);
  const [showSolutions, setShowSolutions] = useState(false);

  useEffect(() => {
    fetchResults();
  }, []);

  const fetchResults = async () => {
    try {
      const response = await api.get('/results/leaderboard');
      setResults(response.data);
    } catch (error) {
      console.error('Error fetching results:', error);
    } finally {
      setLoading(false);
    }
  };

  const downloadCertificate = async (teamId) => {
    try {
      const response = await api.get(`/results/certificate/${teamId}`);
      generateCertificatePDF(response.data);
    } catch (error) {
      console.error('Error downloading certificate:', error);
    }
  };

  const generateCertificatePDF = (certData) => {
    const { teamName, certificateType, eventName, date, certificateId } = certData;

    // Create certificate HTML
    const certificateHTML = `
      <div style="width: 800px; height: 600px; border: 10px solid #gold; padding: 50px; text-align: center; font-family: serif;">
        <h1 style="color: #d4af37; font-size: 48px; margin-bottom: 30px;">CERTIFICATE</h1>
        <h2 style="color: #333; font-size: 24px; margin-bottom: 40px;">
          ${certificateType === 'winner' ? 'WINNER' : certificateType === 'completion' ? 'COMPLETION' : 'PARTICIPATION'}
        </h2>
        <p style="font-size: 18px; margin-bottom: 30px;">This certifies that</p>
        <h3 style="color: #d4af37; font-size: 36px; margin-bottom: 30px; text-decoration: underline;">
          ${teamName}
        </h3>
        <p style="font-size: 18px; margin-bottom: 20px;">
          ${certificateType === 'winner' ? 'has won the' : 'has participated in the'}
        </p>
        <h4 style="color: #333; font-size: 24px; margin-bottom: 40px;">${eventName}</h4>
        <div style="display: flex; justify-content: space-between; margin-top: 80px;">
          <div>Date: ${date}</div>
          <div>Certificate ID: ${certificateId}</div>
        </div>
      </div>
    `;

    // Create and download PDF
    const printWindow = window.open('', '_blank');
    printWindow.document.write(certificateHTML);
    printWindow.document.close();
    printWindow.print();
  };

  if (loading) return <div className="container">Loading results...</div>;

  if (!results) {
    return (
      <div className="container">
        <div className="card" style={{ textAlign: 'center', padding: '40px' }}>
          <h2>Event Still in Progress</h2>
          <p>Results will be available after the event concludes.</p>
        </div>
      </div>
    );
  }

  const winner = results.leaderboard.find(team => team.is_winner);

  return (
    <div className="container">
      <h1>üèÜ Event Results</h1>

      {/* Winner Announcement */}
      {winner && (
        <div className="card" style={{ 
          backgroundColor: '#fff3cd', 
          border: '3px solid #ffc107',
          textAlign: 'center',
          padding: '30px'
        }}>
          <h2 style={{ color: '#856404', fontSize: '32px', marginBottom: '20px' }}>
            üéâ WINNER ANNOUNCEMENT üéâ
          </h2>
          <h3 style={{ color: '#d4af37', fontSize: '28px', marginBottom: '15px' }}>
            {winner.team_name}
          </h3>
          <p style={{ fontSize: '18px', color: '#856404' }}>
            Completed in {Math.round(winner.completion_time_minutes)} minutes
          </p>
          <p style={{ fontSize: '14px', color: '#666' }}>
            First submission: {new Date(winner.final_submission_time).toLocaleString()}
          </p>
        </div>
      )}

      {/* Leaderboard */}
      <div className="card">
        <h2>üìä Leaderboard</h2>
        <div style={{ overflowX: 'auto' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ backgroundColor: '#f8f9fa' }}>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Rank</th>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Team</th>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Status</th>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Time</th>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Members</th>
                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Certificate</th>
              </tr>
            </thead>
            <tbody>
              {results.leaderboard.map((team, index) => (
                <tr key={team.id} style={{ 
                  backgroundColor: team.is_winner ? '#d4edda' : index % 2 === 0 ? '#f8f9fa' : 'white'
                }}>
                  <td style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'center' }}>
                    {team.is_completed ? index + 1 : '-'}
                    {team.is_winner && ' üëë'}
                  </td>
                  <td style={{ padding: '12px', border: '1px solid #ddd', fontWeight: 'bold' }}>
                    {team.team_name}
                  </td>
                  <td style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'center' }}>
                    <span style={{
                      padding: '4px 8px',
                      borderRadius: '4px',
                      backgroundColor: team.is_completed ? '#d4edda' : '#fff3cd',
                      color: team.is_completed ? '#155724' : '#856404'
                    }}>
                      {team.is_completed ? 'Completed' : 'Incomplete'}
                    </span>
                  </td>
                  <td style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'center' }}>
                    {team.completion_time_minutes ? `${Math.round(team.completion_time_minutes)}m` : '-'}
                  </td>
                  <td style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'center' }}>
                    {team.team_size}
                  </td>
                  <td style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'center' }}>
                    <button
                      onClick={() => downloadCertificate(team.id)}
                      className="btn btn-primary"
                      style={{ fontSize: '12px', padding: '4px 8px' }}
                    >
                      Download
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Solutions */}
      <div className="card">
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <h2>üîç Puzzle Solutions</h2>
          <button
            onClick={() => setShowSolutions(!showSolutions)}
            className="btn btn-primary"
          >
            {showSolutions ? 'Hide Solutions' : 'Show Solutions'}
          </button>
        </div>

        {showSolutions && (
          <div style={{ marginTop: '20px' }}>
            {results.solutions.map(solution => (
              <div key={solution.stage_number} style={{ 
                marginBottom: '20px', 
                padding: '16px', 
                backgroundColor: '#f8f9fa',
                borderRadius: '8px'
              }}>
                <h4 style={{ color: '#007bff', marginBottom: '10px' }}>
                  Stage {solution.stage_number}: {solution.title} ({solution.category})
                </h4>
                <p style={{ marginBottom: '10px', fontStyle: 'italic' }}>
                  {solution.puzzle_text}
                </p>
                <div style={{ 
                  padding: '8px 12px', 
                  backgroundColor: '#d4edda',
                  borderRadius: '4px',
                  border: '1px solid #c3e6cb'
                }}>
                  <strong>Answer:</strong> {solution.correct_answer}
                </div>
                {solution.hint && (
                  <p style={{ marginTop: '8px', fontSize: '14px', color: '#666' }}>
                    <strong>Hint:</strong> {solution.hint}
                  </p>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Results;
